INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 0, 2834, 91002, "ペコリーヌとの出会い", "フリーマーケット会場", 0, 5118061, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 0, 2835, 91002, "マホとの出会い", "フリーマーケット会場", 0, 5118062, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 0, 2837, 91002, "アキノとの出会い", "ランドソル市街地", 0, 5118063, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 0, 4108402, 91002, "ジュンとの出会い", "フリーマーケット会場", 0, 5118064, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 0, 4107402, 91002, "カオリとの出会い", "フリーマーケット会場", 0, 5118065, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 1, 9000227, 91002, "ニノンとの出会い", "オーエド町", 0, 5118066, 10118, 2, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 0, 2101181, 91002, "スズナとの出会い", "フリーマーケット会場", 0, 5118067, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 0, 4109402, 91002, "ナナカとの出会い", "ランドソル市街地", 0, 5118068, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 0, 4305402, 91002, "キャル＆コッコロとの出会い", "フリーマーケット会場", 0, 5118069, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 0, 4101402, 91002, "ユカリとの出会い", "ランドソル市街地", 0, 5118070, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 0, 4106402, 91002, "アオイとの出会い", "ランドソル市街地", 0, 5118071, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (8, 40, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 1, 2836, 91002, "シノブとの出会い", "フリーマーケット会場", 0, 5118072, 10118, 3, 1);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 0, "彼女たちの新たな日常", 0, 0, 0, 0, 0, "オープニング", 0, 10145115, 5118600, 10118, 1, 0);
